import Rails from 'rails-ujs'
// Rails.start()

function destroyThis(e) {
    var id = $(this).parent.id();
    Rails.ajax({
        type:'DELETE',
        url: '/user/'+id,
        dataType : 'json',
        success:function(result){
             alert("Usuario borrado correctamente"); 
            }
    });
}
